import { Link } from 'react-router-dom';

export const Navbar = () => {
    return (
        <nav className="nav">
            <Link to="/" className="site-title">Dirty Soles</Link>
            <div className="pages">
                <Link to="/">Home</Link>
                <Link to="/products">Products</Link>
                <Link to="/about">About</Link>
                <Link to="/contact-us">Contact Us</Link>
                <Link to="/admin-user">Admin</Link>
            </div>
        </nav>
    )
};
